async function play() {
  var frames = n.length;
  for (var i = 0; i < frames; i++) {
    document.getElementById("output-home").innerHTML =
      '<font color="' + colour + '"><pre>' + n[i] + "</font></pre>";
    await new Promise((r) => setTimeout(r, 50));
  }
  play();
}

window.onload = function () {
  play();
};

function setColour(hexString) {
  colour = hexString;
}
